import React, {Component}  from "react"
import styled from "styled-components";
import {MemberConsumer} from "./Context";
import {
NavLink,
}
 from "react-router-dom";

export default class MemberCard extends Component {
render () {

const {id, title, img, location, inNetwork} = this.props.member;
    return (
      	<div className="col-9  col-md-5 col-lg-6
      	 my-1">
        <div className = "card">
        <div className = "images-container p-1" onClick={()=> console.log("you clicked me")}>
        <NavLink to = "/Details">
        <img src = {img} alt = "member" className= "card-img-to"/>
      </NavLink>
      </div>
      </div>
      </div>

    );
  }
}
